import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FaUserAlt, FaLock, FaEnvelope, FaPhone } from "react-icons/fa";

const SignupForm = () => {
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [username, setUsername] = useState("");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");
    const [password, setPassword] = useState("");
    const [confirmPassword, setconfirmPassword] = useState("");
    const navigate = useNavigate();

  const handleSignup = async (e) => {
    e.preventDefault();

    // Validation ก่อนส่งฟอร์ม
    const emailPattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    const phonePattern = /^0\d{9}$/;
    const passwordPattern = /^.{8,}$/; 

    if (!emailPattern.test(email)) {
        alert("Invalid email format!");
        return;
    }
    if (!phonePattern.test(phone)) {
        alert("Phone number must be 10 digits and start with 0!");
        return;
    }
    if (!passwordPattern.test(password)) {
        alert("Password must be at least 8 characters!");
        return;
    }
    if (password !== confirmPassword) {
        alert("Passwords do not match!");
        return;
    }

    const newUser = { firstName, lastName, username, email, phone, password};

    const response = await fetch("http://localhost:8080/signup", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newUser),
    });

    if (response.ok) {
        alert("Registration successful!");
        navigate("/login");
    } else {
        const errorText = await response.text();
        alert(`Failed to register: ${errorText}`);
    }
  };

  return (
    <>
        <main className="container">
            <div className="wrapper">
                <form onSubmit={handleSignup}>
                    <h1>Sign Up</h1>
                    <div className="input-box">
                        <input type="text" placeholder="First Name" onChange={(e) => setFirstName(e.target.value)} required />
                        <FaUserAlt className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="text" placeholder="Last Name" onChange={(e) => setLastName(e.target.value)} required />
                        <FaUserAlt className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="text" placeholder="Username" onChange={(e) => setUsername(e.target.value)} required />
                        <FaUserAlt className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="email" placeholder="Email" pattern="^[^\s@]+@[^\s@]+\.[^\s@]+$" onChange={(e) => setEmail(e.target.value)} required />
                        <FaEnvelope className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="text" placeholder="Phone" pattern="^0\d{9}$" onChange={(e) => setPhone(e.target.value)} required />
                        <FaPhone className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="password" placeholder="Password" pattern=".{8,}" onChange={(e) => setPassword(e.target.value)} required />
                        <FaLock className='icon' />
                    </div>
                    <div className="input-box">
                        <input type="password" placeholder="confirmPassword" pattern=".{8,}" onChange={(e) => setconfirmPassword(e.target.value)} required />
                        <FaLock className='icon' />
                    </div>
                    <button type="submit">Sign Up</button>
                    <div className="register-link">
                        <p>Already have an account? <a href="/login">Login</a></p>
                    </div>
                </form>
            </div>
        </main>
    </>
);
};

export default SignupForm;
